export async function customGet(url, successMsg='', failureMsg='') {
  try {
    const response = await fetch(url);
    const data = await response.json();

    return {
      success: true,
      data: data,
      message: successMsg,
    };
  } catch (error) {
    throw new Error({
      success: false,
      data: null,
      message: failureMsg,
    });
  }
}
